import React from 'react';
import {isMobile, SetState} from './Utilities';
import Icons from './Icons';

import { MainNav } from '../types';
import { useNavigation } from '@react-navigation/native';
import { StyleSheet } from 'react-native';
import { Text, View } from '../components/Themed';
import { GlobalStyle, TailwindColors } from '../AppStyles';


function FrontPage(){
    const navigation = useNavigation();

    return <View style={[FrontPageStyle.frontPage, GlobalStyle.col]}>
        <View style={[FrontPageStyle.logoContainer, GlobalStyle.row, GlobalStyle.centerAll, GlobalStyle.centerCross]}>
            {Icons.Logo}
            {/*Leaves*/}
        </View>
        <View style={FrontPageStyle.bottomHalf}>
            <View style={[FrontPageStyle.heading, (isMobile() ? GlobalStyle.col : GlobalStyle.row), GlobalStyle.center]}>
                <Text>Finding</Text>
                <Text><Text style={FrontPageStyle.heading_h1_span}>Name</Text>o</Text>
            </View>
            <View style={[FrontPageStyle.buttons, GlobalStyle.row, GlobalStyle.center]}>
                <button id='login' onClick={() => navigation.navigate(MainNav.LoginPage)}>login</button>
                <button id='signup'onClick={() => navigation.navigate(MainNav.SignInPage)}>sign up</button>
            </View>
        </View>
    </View>;
}

export default FrontPage;



const FrontPageStyle = StyleSheet.create({
    frontPage: {
